const Homepage = () => {

    let name = 'mario';

    const handleClick = function () {
        name = 'luigi';
    }

    return (
        <div className="home">
            <h2>Homepage</h2>
            <button onClick={handleClick}>Click me</button>
        </div>
    );
}

export default Homepage;
